import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Contact from './contact';
import 'bootstrap/dist/css/bootstrap.min.css';
import App2 from './App2';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
     <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} >
          <Route path="Home" element={<Home />} />
          <Route path="Contactus" element={<Contact />} />

          {/* Employee */}
          <Route path="ListEmployee" element={<ListEmp />} />
          <Route path="emp/:id" element={<Employee />} />
          <Route path="empedit/:id" element={<Employeeedit />} />
          <Route path="empdel/:id" element={<Employeedel />} />
          <Route path="empcreate" element={<Employeecreate />} />

          {/* Product */}
          <Route path="ListProduct" element={<ListProduct/>}/>
          <Route path="prod/:id" element={<Product/>}/>
          <Route path="prodedit/:id" element={<Productedit/>}/>
          <Route path="prodcreate" element={<Productcreate/>}/>
          <Route path="proddel/:id" element={<Productdel/>}/>

          {/* Person */}
          <Route path="ListPerson" element={<ListNode/>} />
          <Route path="per/:_id" element={<Person/>} />
          <Route path="peredit/:_id" element={<Personedit/>} />
          <Route path="perdel/:_id" element={<Persondel/>} />
          <Route path="percre" element={<Personcreate/>} />
          <Route path="*" element={<Nopage />} />
        </Route>
      </Routes>
    </BrowserRouter>
    <Contact/>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
